import { PairedDevice, apiKeyToString } from '@fivestars-pos-sdk/types'

describe('apiKeyToString', () => {
    it('should return api key', () => {
        expect(
            apiKeyToString({
                apiKey: '55555',
                apiSecret: '',
                bluetoothMacAddress: '',
                udpPort: 0,
                deviceDescription: '',
                hardwareId: '',
            })
        ).toBe("55555")
    });
});
